function get_tat_friends(){
        var ar_friends=[];
        ar_fr_info=[];
        FB.api('me/posts?fields=likes,comments',function(data){
            obj=data['data'];
            for(x in obj){
                if(obj[x]['likes']!=null){
                    obj_like=obj[x]['likes']['data'];
                    for(y in obj_like){
                        if(ar_friends[obj_like[y]['id']]==null){
